import React, { useState } from 'react';
import uniquid from 'uniqid'

function AgregarUsuarios(){
     //Hooks
     const[nombre,setNombre]=useState('')
     const[apellido,setApellido]=useState('')
     const[email,setEmail]=useState('')
     const[telefono,setTelefono]=useState('')
//estos hooks se leen en la parter inferior

    function agregarPaciente(){
        var paciente={
            nombre:nombre,
            apellido:apellido,
            email:email,
            telefono:telefono,
            idPaciente:uniquid()

        }
        console.log(paciente)

        axios.post('/api/paciente/agregarpaciente',paciente)
        .then(res=>{
            alert(res.data)
        })
        .then(err => {console.log(err)})
       
        





    }


    return (
        <div className='container'>
            <div className='row'>
            <h2>Agregar usuarios</h2>
            
        </div>
        <div className='row'>
            <div className='col-sm-6 offset-3'>
                <div className='mb-3'>
                    <label htmlFor="nombre" className='form-label' value={nombre} onChange={(e)=>{setNombre(e.target.value)}}>Nombre</label>
                    <input type="text"  class="form-control"></input>


                </div>
              
                <div className='mb-3'>
                    <label htmlFor="apellido" className='form-label' value={apellido}
                    onChange={(e)=>{setApellido(e.target.value)}}
                    >Apellido</label>
                    <input type="text"  class="form-control"></input>


                </div>
                <div className='mb-3'>
                    <label htmlFor="email" className='form-label' value={email}
                     onChange={(e)=>{setEmail(e.target.value)}}
                    >Email</label>
                    <input type="email"  class="form-control"></input>


                </div>
                <div className='mb-3'>
                    <label htmlFor="telefono" className='form-label' value={telefono}  onChange={(e)=>{setTelefono(e.target.value)}}>Telefono</label>
                    <input type="email"  class="form-control"></input>


                </div>
                <button onClick={agregarPaciente} className='btn btn-success'>Guardar Paciente</button>


            </div>
         
            
        </div>
        </div>
    )
}
export default AgregarUsuarios;
